Me, You and Doctor Who

Arts Documentary hosted by Matthew Sweet, published by BBC broadcasted as part of BBC The Culture Show series in 2013 - English narration


Information
------------------------------

Why has a kids TV show about a mad man with a box that can travel anywhere in time and space become the BBC's longest running TV drama - and one of Britain's biggest brands? On its 50th anniversary, lifelong fan Matthew Sweet argues you ignore Doctor Who at your peril. It may be a piece of children's television, but he believes it's one of the most important cultural artefacts of modern Britain. Put simply, Doctor Who matters. The Culture Show explores with wit, authority and affection, why Doctor Who has become entrenched in British life. Matthew Sweet traces the 50 years of extraordinary social change and uncertainty that sent generations of children scuttling behind the sofa. How did a pepper pot, the Nazis and a sink plunger result in the scariest adversaries of our time - the Daleks? Sweet argues how in turn the show became a cultural force in its own right, influencing music, design and storytelling.

